import React from 'react';
import '../styles/ProductSection.css';

const products = [
  { id: 1, name: 'T-Shirt', price: '$20' },
  { id: 2, name: 'Shoes', price: '$50' },
  { id: 3, name: 'Watch', price: '$70' },
  { id: 4, name: 'Jacket', price: '$90' },
  { id: 5, name: 'Jeans', price: '$40' },
  { id: 6, name: 'Sunglasses', price: '$30' },
  { id: 7, name: 'Hat', price: '$15' },
  { id: 8, name: 'Backpack', price: '$60' },
];

const ProductSection = () => (
  <div className="product-section">
    <h2>Featured Products</h2>
    <div className="products">
      {products.map(product => (
        <div className="product-card" key={product.id}>
          <img src="https://via.placeholder.com/200x200?text=Product" alt={product.name} />
          <h3>{product.name}</h3>
          <p>{product.price}</p>
        </div>
      ))}
    </div>
  </div>
);

export default ProductSection;
